import React from 'react';

const Home = () => {
    return (
        <section className="section">
            <h2>Welcome to Placement Management</h2>
            <div className="card">
                <p>Find your dream job and prepare for your future with us.</p>
            </div>
        </section>
    );
};

export default Home;
